import React from 'react';

class ResidentCottage extends React.Component {
    render() {
        return (
          <form classname="container" formtext-padding="10 px">
            <div className="container">
                <fieldset>
                <p>Cottage:</p>
                <p>
                    <select>
                    <option value = "1">Willow (Edmonton)</option>
                    <option value = "2">Maple (Red Deer)</option>
                    <option value = "3">Aspen (Red Deer)</option>
                    <option value = "4">Spruce (Red Deer)</option>
                    <option value = "5">Spruce (Lacombe)</option>
                    </select>
                </p>
                </fieldset>
            </div>
        </form>
        );
      }
  }

  export default ResidentCottage;
